export const Buttons = (props) => {
    const { content } = props;

     console.log(props)
  return (
    <div className="buttonContainer">
        {content.map((item) => (

            <div className="buttonSpace">
                <button id="btn" onClick={item.embed}>{item.title}</button>
                <a className="click" href={item.embed}></a>
            </div>

        ))}



    </div>
  )
}

export default Buttons;
